import React, {useState} from 'react';
import './index.css';

const  App = ()=>{

    const [firstName,setFirstName] = useState();
    const [lastName,setLastName] = useState();
    const [firstNameNew , setFirstNameNew ] = useState();
    const [lastNameNew, setLastNameNew] = useState();

    const inputFirstName = (event)=>{
        setFirstName(event.target.value);
    }

    const inputLastName = (event)=>{
        setLastName(event.target.value);
    }


    const SubmitFunc = (event)=>{
        event.preventDefault();
        setFirstNameNew(firstName);
        setLastNameNew(lastName);
    }
    

    return(
    <>  
        <form onSubmit={SubmitFunc}>
            <div>
                    <h1>Hello </h1><br/>
                    <input style={{textAlign:'center'}} type='text' placeholder='Please Enter first Name' value={firstName} onChange={inputEvent} />&nbsp;&nbsp;<br/>
                    <input style={{textAlign:'center'}} type='text' placeholder='Please Enter Last Name' value={lastName} onChange={inputEvent} />&nbsp;&nbsp;
                    <input style={{textAlign:'center'}} type='text' placeholder='Please Enter Email Address' value={email} onChange={inputEvent} />&nbsp;&nbsp;
                    <button>Submit</button>
            </div>
        </form>
    </>
    )
}

export default App;
